script: |
  super -f text -I q2612.spq | sort > q2612.out

inputs:
  - name: q2612.spq
    data: |
      SELECT DISTINCT col2 + - 8 * + col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT col2 * col0 < - col2 * - 93 + col0 - + 66 + + - col2 * - - col0 * + col2 );
  - name: tab0

outputs:
  - name: q2612.out
    data: |
